"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H40567109\">",
"      <span class=\"h1\">",
"       How are insect bites and stings different?",
"      </span>",
"      &nbsp;&mdash;&nbsp;When an insect bites you, it uses its mouth parts. When an insect stings you, it uses a special &ldquo;stinger&rdquo; on the back of its body.",
"     </p>",
"     <p>",
"      Biting insects usually bite other people and animals, too. When they bite you, they can transfer blood from their other victims to you. That means that they can infect you with the diseases their other victims have. Mosquitoes, for example, can carry a few infections. And certain types of ticks can infect you with the germ that causes Lyme disease.",
"     </p>",
"     <p>",
"      Stinging insects, such as bees, wasps, and fire ants, do not usually carry disease. But stinging insects can inject you with venom that can irritate your skin. Plus, insect stings can be deadly to people who are severely allergic to the insect venom.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H40567116\">",
"      <span class=\"h1\">",
"       What should I do if I am stung by a bee, wasp, or fire ant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are stung by a bee or wasp, quickly remove the stinger from your skin if it is still there. If you are stung by a fire ant, kill the ant with a slap as soon as you feel the sting.",
"     </p>",
"     <p>",
"      Some people have a severe allergic reaction to insect stings called anaphylaxis. Call 9-1-1 for an ambulance if you suddenly:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Have trouble breathing, become hoarse, or start wheezing (hearing a whistling sound when you breathe)",
"       </li>",
"       <li>",
"        Start to swell, especially around the face, eyelids, ears, mouth, hands, or feet",
"       </li>",
"       <li>",
"        Develop belly cramps, nausea, vomiting, or diarrhea",
"       </li>",
"       <li>",
"        Feel dizzy or pass out",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H40567123\">",
"      <span class=\"h1\">",
"       What is a normal reaction to an insect sting?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Insect stings can cause the area around the sting to swell, turn red, hurt, and feel hot (",
"      <a class=\"graphic graphic_figure graphicRef63900 \" href=\"UTD.htm?23/37/24144\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      To treat the pain and swelling around the area of the sting, you can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Wash the area with soap and cool water",
"       </li>",
"       <li>",
"        Keep the area clean and try not to scratch it",
"       </li>",
"       <li>",
"        Put a cold, damp washcloth on the area",
"       </li>",
"       <li>",
"        Take or apply anti-itch medicine",
"       </li>",
"       <li>",
"        Take a non-prescription pain medicine for the pain",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H40567130\">",
"      <span class=\"h1\">",
"       What should I know about tick bites?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Ticks are found in the grass and on shrubs, and can attach to people walking by. One type of tick can spread Lyme disease. But a tick has to stay attached for a while before it can give you the infection. If you are bitten by a tick, gently remove the tick from your skin, using tweezers. If you can&rsquo;t remove a tick, see your doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H40567137\">",
"      <span class=\"h1\">",
"       What can I do to reduce the chances of getting bitten or stung?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Wear shoes, long-sleeved shirts, and long pants when you go outside. If you are worried about ticks, tuck your pants into your socks and wear light colors so you can spot any ticks that get on you.",
"       </li>",
"       <li>",
"        Wear bug spray",
"       </li>",
"       <li>",
"        Stay inside at dawn and dusk, when mosquitoes are most active",
"       </li>",
"       <li>",
"        Drain areas of standing water near your home, such as wading pools and buckets. Mosquitoes breed in standing water.",
"       </li>",
"       <li>",
"        Keep foods and drinks covered when you are outside",
"       </li>",
"       <li>",
"        If you see a stinging insect, stay calm and slowly back away",
"       </li>",
"       <li>",
"        If you live in an area that has fire ants, avoid stepping on ant mounds",
"       </li>",
"       <li>",
"        If you find an insect nest in or near your house, call a pest-control service to get rid of the nest safely",
"       </li>",
"      </ul>",
"     </p>",
