var title_f14_51_15164="Detection of pathologic minor papilla narrowing";
var content_f14_51_15164=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F69143&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F69143&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Detection of pathologic minor papilla narrowing",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Non-invasive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dorsal duct dilation or chronic pancreatitis changes confined to the dorsal pancreas as seen on CT scan",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prolonged dilation of the dorsal duct diameter after intravenous secretin stimulation, as monitored by transcutaneous ultrasound (or CT or endoscopic ultrasound)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Diagnostic ERCP",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal dorsal ductography (dilation and/or chronic pancreatitus changes) in combination with a normal ventral ductogram",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cystic dilation of the terminal dorsal duct (santorinicele)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Slow drainage of contrast from the dorsal duct (&ge;12 minutes)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pain provocation during dorsal ductography",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Special/therapeutic ERCP",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Collection of pure pancreatic juice after deep dorsal duct cannulation and intravenous secretion stimulation (abnormal bicarbonate level &lt;105 mEq/L or volume &lt;3 mL/minute)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Manometry of the minor papilla (abnormal ? &gt;40 mmHg)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Observation of the degree of resistance to passage of .035 inch diameter guidewire and/or 3, 4, or 5 French dilation catheter over a guidewire passed into dorsal duct",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diagnostic/therapeutic trial of minor papilla dilation, stenting, and/or sphincterotomy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Intraoperative",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Resistance to passage of a .75 mm diameter lacrimal probe into the minor papilla (after laparotomy and duodenostomy)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Observation of parenchymal chronic pancreatitus changes limited to the dorsal pancreas",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Histology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Observation of parenchymal chronic pancreatitis changes limited to the dorsal pancreas",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CT: computed tomography; ERCP: endoscopic retrograde cholangiopancreatography.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
